import React from 'react';
import Navigator from './Navigator';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';



export default function CreateCourse(){
    return <div>
        <Navigator />
        <h1 className="createCourseTitle">新增課程</h1>

        <Row>

            <Col lg={{span: 6, offset: 3}}>

                <Row className="courseForm">
                    <Col lg={4}>
                        <Form.Group>
                            <Form.Label className="inputLabel">課程名稱:</Form.Label>
                            <Form.Control placeholder="請輸入課程名稱" className="input" name="courseName" type="text"></Form.Control>
                        </Form.Group>
                    </Col>
                    <Col lg={{span: 4, offset: 1}}>
                        <Form.Group>
                            <Form.Label className="inputLabel">課程日期:</Form.Label>
                            <Form.Control placeholder="請輸入課程日期" className="input" name="courseDate" text="date"></Form.Control>
                        </Form.Group>
                    </Col>
                </Row>

            </Col>

        </Row>


    </div>
}
